  false,\n\t\"url\": null,\n\t\"notes\": \"LiDAR data is remotely sensed high-resolution
  elevation data collected by an airborne collection platform. The LiDAR files were
  converted from .PTS format to LAS V1.2. All data is Bare Earth, with 99% of all
  buildings removed and 95% of all vegetation removed. There is no information available
  for return number, scan angle, GPS time, or intensity. This data set covers approximately
  1,233.83 square miles (3,195.6 sq km) of the Connecticut River.\",\n\t\"license_title\":
